import React from 'react';
import wall1 from '../images/wall1.jpeg';
import wall2 from '../images/wall2.jpeg';
import wall3 from '../images/wall3.jpeg';
import wall4 from '../images/wall4.jpeg';
import wall5 from '../images/wall5.jpeg';
import wall6 from '../images/wall6.jpeg';
import wall7 from '../images/wall7.jpeg';
import wall8 from '../images/wall8.jpeg';
import wall9 from '../images/wall 9.jpeg'

const HomePage = () => {
  return (
    <div>
      <img src={wall1} alt="wall1" />
      <img src={wall2} alt="wall2" />
      <img src={wall3} alt="wall3" />
      <img src={wall4} alt="wall4" />
      <img src={wall5} alt="wall5" />
      <img src={wall6} alt="wall6" />
      <img src={wall7} alt="wall7" />
      <img src={wall8} alt="wall8" />
      <img src={wall9} alt="wall9" />
    </div>
  );
};

export default HomePage;
